answer:
The matrix I am inverting is hidden in the code I provided, its procedurally generated to make comparing matlab and C a little easier.

`for(int i = 0; i < matSize; i++) {
    for(int j = 0;j < matSize; j++) {
        GSL_SET_COMPLEX(&temp,i+1,j+1);
        gsl_matrix_complex_set(mat,i,j,temp);
    }
}`

Comparing LU decomposition in Matlab vs GSL, they are comparable. The only issue is when the exponents get super small (around -16) in C they are rounded to 0.

