MongoDB push existing field value to another field in an array of objects<p>If I have a document like this:</p>
<pre><code>db.people.insertOne({name: &quot;Annie&quot;, latestScore: 5});
</code></pre>
<p>Then based on <a href="https://stackoverflow.com/a/37280419/5800527">this answer</a>, I am able to move <code>latestScore</code> to an array field like this:</p>
<pre><code>db.people.updateOne(
    {name: 'Annie'},
    [
        {$set: 
            {scoreHistory: 
                {$concatArrays: [
                    {$ifNull: [&quot;$scoreHistory&quot;, []]},
                    [&quot;$latestScore&quot;]
                ]}
            }
        }, 
        { $unset: [&quot;latestScore&quot;] }
    ]
);
</code></pre>
<p>This is the resulting document:</p>
<pre><code>{
  _id: ObjectId(&quot;61d2737611e48e0d0c30b35b&quot;),
  name: 'Annie',
  scoreHistory: [ 5 ]
}
</code></pre>
<p>Can we perform the same update to objects nested in an array? For example, if the document is like this:</p>
<pre><code>db.people.insertOne({
    name: 'Annie',
    words: [
        {word: &quot;bunny&quot;, score: 5},
        {word: &quot;pink&quot;, score: 5}
    ]
});
</code></pre>
<p>How can we update it to this:</p>
<pre><code>{
    name: 'Annie',
    words: [
        {word: &quot;bunny&quot;, scoreHistory: [5]},
        {word: &quot;pink&quot;, scoreHistory: [5]}
    ]
}
</code></pre>
<p>I know I can iterate and modify the array from the app and update the whole array at once, but I would like to do it using operators like in the first example above.</p>
<p>The website first displays <code>words.word</code> and <code>words.score</code> in rows, clicking on a row shows <code>words.scoreHistory</code> in a popup. I am expecting words array to be less than 500. Any advise on remodelling the schema to simplify the above operation is also welcome!</p>

