How to properly unit test mongoDB CRUD result<p>My application mostly consists of CRUDs to/from MongoDB using <code>mongo-go-drive</code> package. This function is one of gRPC server services and all it does is calling database method <code>action.GetProducts(ctx)</code> and it returns <code>*mongo.cursor</code>. Then the result is decoded. For each document, I put the document content into a singular product struct, then append it to products slices (the <code>GetProductsResponse</code> struct is made using gRPC proto <code>repeated GetProductResponse</code> type). After appending all product into <code>GetProductsResponse</code>, I return the response to gRPC client.</p>
<p>I am also new to testing in general, how should I break down the function and do the mocking (how to mock the cursor?) for unit testing? Is it even necessary in the first place to do unit test on the function even though all it does is appending the result, or should I just go straight for the integration test and skip the unit test since it involves database I/O?</p>
<pre><code>func (s *Server) GetProducts(ctx context.Context, in *pb.EmptyRequest) (*pb.GetProductsResponse, error) {
    cursor, err := action.GetProducts(ctx)
    if err != nil {
        return nil, err
    }

    products := pb.GetProductsResponse{}

    res := model.Product{}

    for cursor.Next(ctx) {
        // Convert document to above struct
        err := cursor.Decode(&amp;res)
        if err != nil {
            return nil, fmt.Errorf(&quot;failed to decode document: %v&quot;, err)
        }

        product := &amp;pb.GetProductResponse{ProductId: res.Product_id.Hex(), Name: res.Name, Price: res.Price, Qty: int32(res.Qty)}

        products.Products = append(products.Products, product)
    }

    return &amp;products, nil
}
</code></pre>

