Image missing with an Error: Cannot set header after they are sent to client<p>I converted my old Demo project to MVC style by separating model, view &amp; control, added a new controller folder. All functionalities are working perfectly fine, except the storing of an image. I am getting an error: <code>Error [ERR_HTTP_HEADERS_SENT]: Cannot set headers after they are sent to the client</code></p>
<p>I did some debugging &amp; found out <em><strong>image is present during validation, but it is not present when it is sent to request handler</strong></em> to store the db object. <a href="https://i.stack.imgur.com/rMs4X.png" rel="nofollow noreferrer">Please check this image of debugging output</a></p>
<p>There is also a strange error in the DB. <strong>title, body &amp; image path</strong> is getting inserted two times inside DB. I deleted the old stuff &amp; tried it again &amp; again. But still noticed, for one insertion using <em>'/posts/new'</em> page: two same objects is getting stored in mongodb.  <a href="https://i.stack.imgur.com/pDY3C.png" rel="nofollow noreferrer">Image attached from Mongo DB compass</a></p>
<p>Here is the project flow: The request object with the  image is picked from '/posts/new' page, validated in the validation middleware, if  title &amp; image are present: it will be sent to the request handler <code>app.post('/posts/store', storePostController);</code> which will store the image using path &amp; it will store a mongo db document which contains title, body &amp; image path inside the DB.</p>
<p>The code for the following is given below:
<strong>1) createPost.ejs</strong></p>
